from typing import List
# Definition for singly-linked list.
import numpy as np


class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        length = len(s)
        if length == 0:
            return 0

        res = np.zeros((length, length), dtype = np.int8,)

        charSet = set()

        for i in range(length):
            res[i][i] = 1
        # maxValue = 1
        for j in range(length):
            for k in range(j-1, -1, -1):
                if s[j] in s[k:j]:
                    res[k][j] = res[k-1][j]
                else:
                    res[k][j] = res[k][j-1]+1
                # print(res[0][0]+1)
                
            #     print(res)

            #     print()
            # print("------------")
        print(res)
        return int(res[0][length-1]) 


if __name__ == "__main__":
    solution = Solution()
    # print("@main")
    res = solution.lengthOfLongestSubstring("pwwkew")
    print(res)

